CREATE TABLE `dex` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `pokemon_name` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `dex_number` smallint(5) unsigned DEFAULT NULL,
  `type` varchar(8) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `bp` tinyint(3) unsigned DEFAULT NULL,
  `rml` tinyint(3) unsigned DEFAULT NULL,
  `has_mega` tinyint(1) unsigned DEFAULT NULL,
  `base_pokemon` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `stone_name` varchar(14) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `base_icons` tinyint(3) unsigned DEFAULT NULL,
  `msu` tinyint(3) unsigned DEFAULT NULL,
  `mission_card` tinyint(3) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `pokemon_name` (`pokemon_name`),
  KEY `fk_mega_base_pokemon` (`base_pokemon`),
  CONSTRAINT `fk_mega_base_pokemon` FOREIGN KEY (`base_pokemon`) REFERENCES `dex` (`pokemon_name`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1187 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
