INSERT INTO `mega_effect` VALUES (1,'3CloneSame','Changes up to 3 Pokémon of the same type as the Mega into the Mega.','Normal damage per match. Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(2,'Boundary1','Erases all icons directly adjacent to the match.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(3,'Boundary2','Erases all icons within 2 squares horizontally & vertically of the match.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(4,'Center','Erases up to 12 icons in the shape of a circle 2 spots from the center.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(5,'CloneLeft','Turns the icons to the left of all Mega Pokémon not used in the match into another Mega.','Normal damage per match. Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(6,'CloneUp','Turns the icons above all Mega Pokémon not used in the match into another Mega.','Normal damage per match. Multipliers from type matchup, combos, & Attack Power Up still apply.'),(7,'DiagLR','Erases up to 12 icons in three diagonal lines from top-left to bottom-right.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(8,'DiagRL','Erases up to 12 icons in three diagonal lines from top-right to bottom-left.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(9,'Erase10Barriers','Erases up to 10 Pokémon & disruptions covered by barriers (which are scanned vertically).','Initial match + 100 for each block removed. Multipliers from type matchup & skills still apply. Attack Power Up & combos only affects the initial match.'),(10,'Erase10Blocks','Erases up to 10 blocks (which are scanned horizontally).','Initial match + 100 for each block removed. Multipliers from type matchup & skills still apply. Attack Power Up & combos only affects the initial match.'),(11,'Erase10Diff','Erases up to 10 of a single Pokémon that\'s NOT the same type as the Mega.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(12,'Erase10Disrupts','Erases up to 10 of any combination of rocks, blocks, & coins (which are scanned horizontally).','Initial match + 50 for each block removed. Multipliers from type matchup & skills still apply. Attack Power Up & combos only affects the initial match.'),(13,'Erase10Same','Erases up to 10 of a single Pokémon that\'s the same type as the Mega.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(14,'EraseAllSelf','Erases all Mega icons on the screen.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(15,'O','Erases up to 12 icons in an O shape around the edge of the screen.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(16,'RandomH','Two bolts cross the screen from left to right on a random path. The paths may overlap.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(17,'RandomV','Two bolts cross the screen from top to bottom on a random path. The paths may overlap.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(18,'Tap1','Time freezes for 3 seconds upon activation. Tap up to 1 spot to clear up to 9 icons in a 3x3 area.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(19,'Tap2','Time freezes for 3 seconds upon activation. Tap up to 2 spots to clear up to 10 icons (5 each) in a + shape.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(20,'Tap3','Time freezes for 3 seconds upon activation. Tap up to 3 spots to clear up to 15 icons (5 each) in a + shape.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(21,'V','Erases up to 12 icons in a V shape.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(22,'VH','Erases up to 12 icons in a > shape.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(23,'WallH','Erases all icons in the columns to the left & right of the match. Vertical matches are recommended.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(24,'WallV','Erases all icons in the rows above & below the match. Horizontal matches are recommended.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(25,'X','Erases up to 12 icons in an X shape.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(26,'Y','Erases up to 12 icons in a Y shape.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(27,'ZigZagH','Two bolts cross the screen from left to right on a zigzag path. The paths do not overlap.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.'),(28,'ZigZagV','Two bolts cross the screen from top to bottom on a zigzag path. The paths do not overlap.','Initial match + (attack power x 0.2 for each icon removed, rounded down). Multipliers from type matchup, skills, combos, & Attack Power Up still apply.');
