DROP TABLE IF EXISTS `pokemon_skill`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pokemon_skill` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `pokemon_name` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `skill_name` varchar(17) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `is_primary` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `pokemon_name` (`pokemon_name`,`skill_name`),
  KEY `fk_pokemon_skill` (`skill_name`),
  CONSTRAINT `fk_pokemon_skill` FOREIGN KEY (`skill_name`) REFERENCES `skill` (`skill_name`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_skill_pokemon` FOREIGN KEY (`pokemon_name`) REFERENCES `dex` (`pokemon_name`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1345 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

