  `default_1` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `default_2` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `default_3` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `default_4` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `forced_5` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `forced_6` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
