  `rate_2` decimal(5,2) DEFAULT NULL,
  `rate_3` decimal(5,2) DEFAULT NULL,
  `m5_t10` tinyint(1) unsigned DEFAULT NULL,
  `exp` tinyint(1) unsigned DEFAULT NULL,
  `ms` tinyint(1) unsigned DEFAULT NULL,
  `dd` tinyint(1) unsigned DEFAULT NULL,
  `c1` tinyint(1) unsigned DEFAULT NULL,
  `atk` tinyint(1) unsigned DEFAULT NULL,
